    false,nt"url": null,nt"notes": " The Topological Faces / Area Hydrography
    Relationship Files (FACESAH.dbf) contain a record for each face / area hydrography
    feature relationship.  Facen               refers to the areal (polygon) topological
    primitives that make up MTDB.  A face is bounded by one or more edges; its boundary
    includes only the edgesn               that separate it from other faces, not any
    interior edges contained within the area of the face.  The face to which a record
    in the Topological Faces /n               Area Hydrography Relationship File (FACESAH.dbf)
    applies can be determined by linking to the Topological Faces Shapefile (FACES.shp)
    using the permanentn               topological face identifier (TFID) attribute.
     The area hydrography feature to which a record in the Topological Faces / Area
    Hydrography Relationshipn               File (FACESAH.dbf) applies can be determined
    by linking to the Area Hydrography Shapefile (AREAWATER.shp) using the area hydrography
    identifier (HYDROID)n               attribute.  A face may be part of multiple area
    water features.  An area water feature may consist of multiple faces.n               n
                  The TIGER/Line shapefiles and related database files (.dbf) are an
    extract of selected geographic and cartographic information from then               U.S.
    Census Bureau's Master Address File / Topologically Integrated Geographic Encoding
    and Referencing (MAF/TIGER) Database (MTDB).  The MTDB representsn               a
    seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
    shapefile is designed to stand alone as an independent data set,n               or
    they can be combined to cover the entire nation.n            ",nt"license_title":
